(132, 1, '2019-06-22 02:16:37', '2019-06-22 02:16:37', '<!-- wp:paragraph -->\n<p> Combine rice samba writers aren\'t people exactly. or, if they\'re any good, they\'re a whole lot of people trying so hard to be one person. it\'s like actors, who try so pathetically not to look in mirrors. who lean backward trying--only to see their faces in the reflecting chandeliers. the fear of death follows from the fear of life. a man who lives fully is prepared to die at any time. you can\'t help respecting anybody who can spell tuesday, even if he doesn\'t spell it right. the man i am writing about is not famous. it may be that he never will be.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[133,134,135,136,137,139]} -->\n<ul class=\"wp-block-gallery columns-3 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-3/wp-content/uploads/2019/06/chicken-burrito-1024x576.jpg\" alt=\"\" data-id=\"133\" data-link=\"http://localhost/wp-3/?attachment_id=133\" class=\"wp-image-133\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-3/wp-content/uploads/2019/06/chili-con-carne-378952_1920-1024x649.jpg\" alt=\"\" data-id=\"134\" data-link=\"http://localhost/wp-3/?attachment_id=134\" class=\"wp-image-134\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-3/wp-content/uploads/2019/06/crab-1024x576.jpg\" alt=\"\" data-id=\"135\" data-link=\"http://localhost/wp-3/?attachment_id=135\" class=\"wp-image-135\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-3/wp-content/uploads/2019/06/korean-dish-1024x670.jpg\" alt=\"\" data-id=\"136\" data-link=\"http://localhost/wp-3/?attachment_id=136\" class=\"wp-image-136\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-3/wp-content/uploads/2019/06/spicy-buffalo-wings-1024x768.jpg\" alt=\"\" data-id=\"137\" data-link=\"http://localhost/wp-3/?attachment_id=137\" class=\"wp-image-137\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-3/wp-content/uploads/2019/06/cuisine-2248567_1920-1024x660.jpg\" alt=\"\" data-id=\"139\" data-link=\"http://localhost/wp-3/?attachment_id=139\" class=\"wp-image-139\"/></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph -->\n<p>It may be that when his life at last comes to an end he will leave no more trace of his sojourn on earth than a stone thrown into a river leaves on the surface of the water. but it may be that the way of life that he has chosen for himself and the peculiar strength and sweetness of his character may have an ever-growing influence over his fellow men so that, long after his death perhaps, it may be realized that there lived in this age a very remarkable creature. when you have found your own room, be kind to those who have chosen different doors and to those who are still in the hall. you are worried about seeing him spend his early years in doing nothing. what! is it nothing to be happy?  </p>\n<!-- /wp:paragraph -->', 'Tasting spicy food', 'I tried great mexican food, it was really really spicy', 'publish', 'open', 'open', '', 'tasting-spicy-food', '', '', '2019-06-23 14:23:53', '2019-06-23 14:23:53', '', 0, 'http://localhost/wp-3/?p=132', 0, 'post', '', 0),
